import styled from 'styled-components'

export const MainContainerStyled = styled.main`
	display: flex;
	flex-wrap: wrap;
	padding: 30px;
	align-items: center;
	justify-content: center;
`
export const ListItemStyled = styled.ul`
	display: flex;
	flex-wrap: wrap;
	padding: 0;
	margin: 0;
	gap: 29px;
`
export const CarAdvertContainerStyled = styled.li`
	flex-basis: calc(25% - 29px);
	flex-shrink: 0;
	margin-bottom: 20px;
`
